import './App.css';
import { BrowserRouter as Router,Route,Switch } from 'react-router-dom';
import LoginForm from './LoginForm';
import RegisterForm from './RegisterForm';

function App() {
  return (
    <Router>      

    <Routes>
      <Route path="/">
          <LoginForm/>
      </Route>
      <Route path="RegisterForm">
          <RegisterForm/>
      </Route>

    </Routes>

    </Router>
  );
}

export default App;
